import styled from "styled-components/native";

export const Page = styled.KeyboardAvoidingView`
    flex: 1;
    padding: 20px;
`;

export const HomeTopIcon = styled.View`
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const TitleHome = styled.Text`
    font-size: 40px;
    text-align: center;
    text-transform: uppercase;
`;
